import '../App.css';
import Bb1 from '../components/Bb1';
import Bb2 from '../components/Bb2';
import Bb3 from '../components/Bb3';
import Bb4 from '../components/Bb4';
import Bb5 from '../components/Bb5';
import Bb6 from '../components/Bb6';
import Bb7 from '../components/Bb7';
import Bb8 from '../components/Bb8';
import Bb9 from '../components/Bb9';
import Bp1 from '../components/Bp1';
import Bp2 from '../components/Bp2';
import Bp3 from '../components/Bp3';
import Kr1 from '../components/Kr1';
import Kr2 from '../components/Kr2';
import Kr3 from '../components/Kr3';
import Kr4 from '../components/Kr4';
import Kr5 from '../components/Kr5';


const App = () => {
  return (
    <div className="container">
        <div class="header">
          <h1>Kaori & Nader</h1>
        </div>
        <div id="gallery">
          <Bb1 />
          <Bb2 />
          <Bb3 />
          <Bb4 />
          <Bb5 />
          <Bb6 />
          <Bb7 />
          <Bb8 />
          <Bb9 />
          <Bp1 />
          <Bp2 />
          <Bp3 />
          <Kr1 />
          <Kr2 />
          <Kr3 />
          <Kr4 />
          <Kr5 />

        </div>
    </div>
  )
}

export default App;
